import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom'
import logo from 'logo.svg';
import 'App.css';
import { Button } from 'reactstrap';
import axios from 'axios';

// Import pages
import LandingPage from 'pages/landing-page';
import About from 'pages/about';
import Contact from 'pages/contact';
import Login from 'pages/login';

import Home from 'pages/home';
import ReportsList from 'pages/reports-list';
import SingleReport from 'pages/single-report';
import Error from 'pages/error';

// New report pages
import NewReport from 'pages/new-report';
import Lagoon from 'pages/lagoon';



function App() {
  return (
    <div className="App">
      <Router>
        <Switch>
          <Route exact path='/' component={Lagoon} />

          {/* Non-logged in pages */}
          {/*
          <Route exact path='/' component={} />
          <Route exact path='/about' component={} />
          <Route exact path='/contact' component={} />
          <Route exact path='/login' component={} />
          */}

          {/* Logged in pages */}
          {/*
          <Route exact path='/home' component={} />
          <Route exact path='/new-report' component={} />
          <Route exact path='/new-report/lagoon' component={Lagoon} />
          <Route exact path='/reports' component={} />
          <Route exact path='/reports/id' component={} />

          <Route component={Error} /> */}  {/* When no other route matches */}
        </Switch>
      </Router>
    </div>
  );
}

export default App;
